import React, { useState } from 'react';

const FetchDataPage = () => {
  const [searchCriteria, setSearchCriteria] = useState({
    name: '',
    school: '',
    week: '',
  });
  const [fetchedData, setFetchedData] = useState('');

  const handleFetchData = async () => {
    try {
      // Construct the query string based on the entered criteria
      const queryString = Object.entries(searchCriteria)
        .filter(([key, value]) => value)
        .map(([key, value]) => `${key}=${encodeURIComponent(value)}`)
        .join('&');

      const response = await fetch(`/api/entries?${queryString}`);
      const result = await response.json();

      if (result.message) {
        setFetchedData(result.message);
      } else {
        // Display the fetched data
        setFetchedData(`Name: ${result.name}, Week: ${result.week}, School: ${result.school}, Staff Name: ${result.staffName}, Competencies Met: ${result.competenciesMet}`);
      }

      console.log(result);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
      <h2>Fetch Data</h2>
      <label htmlFor="name">Name:</label>
      <input type="text" value={searchCriteria.name} onChange={(e) => setSearchCriteria({ ...searchCriteria, name: e.target.value })} />

      <label htmlFor="school">School:</label>
      <input type="text" value={searchCriteria.school} onChange={(e) => setSearchCriteria({ ...searchCriteria, school: e.target.value })} />

      <label htmlFor="week">Week:</label>
      <input type="text" value={searchCriteria.week} onChange={(e) => setSearchCriteria({ ...searchCriteria, week: e.target.value })} />

      <button onClick={handleFetchData}>Submit</button>

      <div>
        <strong>Fetched Data:</strong> {fetchedData}
      </div>
    </div>
  );
};

export default FetchDataPage;
